if mibBuilder.loadTexts: pduOutletSwitchedControlCommand.setDescription("Getting this variable will return the outlet state. If the outlet is on, the immediateOn (2) value will be returned. If the outlet is off, the immediateOff (1) value will be returned. If the state of the outlet cannot be determined, the outletUnknown (7) value will be returned. If the outletUnknown condition should occur, all devices powered by the PDU should be shut down. The PDU's power should then be cycled to clear this condition. Setting this variable to immediateOn (2) will immediately turn the outlet on. Setting this variable to immediateOff (1) will immediately turn the outlet off. Setting this variable to immediateReboot (5) will cause the Switched PDU to perform an immediateOff command, wait the pduOutletSwitchedConfigRebootDuration OID time, and then perform an immediateOn command. Setting this variable to delayedOn (4) will turn the outlet on after the pduOutletSwitchedConfigPowerOnTime OID time has elapsed. Setting this variable to delayedOff (3) will turn the outlet off after the pduOutletSwitchedConfigPowerOffTime OID time has elapsed. Setting this variable to delayedReboot (6) will cause the Switched PDU to perform a delayedOff command, wait the pduOutletSwitchedConfigRebootDuration OID time, and then perform a delayedOn command.")
